using namespace std;

int countWordOccurences(const string& word, const string& filename) {
    int count = 0;
    string line;
    ifstream file(filename);

    if (file.is_open()) {
        while (getline(file, line)) {
            size_t pos = 0;
            while ((pos = line.find(word, pos)) != string::npos) {
                count++;
                pos += word.length(); // Skip matched word to find next occurrence
            }
        }
        file.close();
    } else {
        cout << "Error: Could not open file " << filename << endl;
    }

    return count;
}

